import React from 'react';

const Menu = () => {
    return (
        <header className="app-menu">
            <nav className="nav-principal">
                 <a href="#">Administrar</a>
            </nav>
            <a href="#">Administrar</a>
            <a href="#">Jugadores</a>
            <a href="#">Partidos</a>
            <a href="#">Entrenamientos</a>
            <a href="#">Rivales</a>
            <a href="#">Reportes</a>
        </header>
    );
}
export default Menu;
